import React from 'react';
import { updateNewMessageActionCreater, addMessageActionCreater } from '../../../reducers/dialogs-reducer';
import StoreContext from '../../../StoreContex';
import Dialogs from './Dialogs';



const DialogsContainer = (props) => {
    let state = props.store.getState();


    let onMessageChange = (text) => {
        store.dispatch(updateNewMessageActionCreater(text));
    }

    let addNewMessage = () => {
        store.dispatch(addMessageActionCreater());
    }

    return <StoreContext.Consumer>
        <Dialogs updateNewMessageActionCreater={onMessageChange} addMessageActionCreater={addNewMessage} dialogsData={state.dialogsReducer.dialogsData} messagesData={state.dialogsReducer.messagesData} />
    </StoreContext.Consumer>
}

export default DialogsContainer;
